Tooth Fairy (2010)

Verenigde Staten / Canada
Komedie / Fantasy
101 minuten

geregisseerd door Michael Lembeck
met Dwayne Johnson, Julie Andrews en Ashley Judd

De film gaat over Derek 'The Tooth Fairy' Thompson, een erg agressieve speler bij ijshockey. Hij heeft deze bijnaam gekregen omdat hij vaak de tanden van zijn tegenspelers eruit slaat. Als hij de dromen van een jongetje kapot maakt, is zijn straf dat hij, voor een week, een echte tandenfee moet spelen, met tutu, vleugels en een toverstokje. Eerst klungelt hij vooral veel in het huis van mensen, maar na een tijdje raakt hij eraan gewend en wordt hij herinnerd aan zijn eigen vergeten dromen.

Vanaf 29 april in de bioscoop

